import{Grid,Cell} from 'react-mdl';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => <div>{text}</div>;
const Marker = props => {
    return <div className="SuperAwesomePin"></div>
  }
const handleApiLoaded = (map, maps) => {
    let marker = new maps.Marker({
        position: myLatLng,
        map,
        title: 'Hello World!'
      });
};

class Map extends Component {
    static defaultProps = {
        center: {
          lat: 28.6498816,
          lng: 77.13751040000001
        },
        zoom: 11
      };

  render() {
    return(
      <div>
        <Grid>
          <Cell  col={6}>
            <div style={{textAlign:'center' , height: '100vh', width: '100%'}}>
            <GoogleMapReact
          bootstrapURLKeys={{ key: 'AIzaSyD5_CXp9sP-LDEhFihSy0lNtR9BUvq_tGQ' }}
          defaultCenter={this.props.center}
  defaultZoom={this.props.zoom}
  yesIWantToUseGoogleMapApiInternals
  onGoogleApiLoaded={({ map, maps }) => handleApiLoaded(map, maps)}
>
<Marker lat={28.6498816} lng={77.13751040000001} />

        </GoogleMapReact>
             </div>
          </Cell>
          <Cell className="resume-right-col" col={6}>


          </Cell>

        </Grid>
      </div>
    )
  }
}

export default Map;
